import React from "react";


function Card(props){
    return(
        // <img src={props.img} alt="avatar_img" />
    <>
            <div className="top">

                <img className="circle-img" src={props.img} alt={props.img} />
            </div><div className="bottom">
                <h2 className="name">{props.name}</h2>
            </div></>

    );
}

export default Card;
